import React from 'react';
import { Table } from 'reactstrap';

export default class Cart extends React.Component {
  render() {
    return (
      <Table>
        <thead>
          <tr>
            <th></th>
            <th>Sản phẩm</th>
            <th>Giá</th>
            <th>Số lượng</th>
            <th>Tạm tính</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th scope="row">1</th>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
            <td>@mdo</td>
          </tr>
        </tbody>
      </Table>
    );
  }
}
